from sympy import primerange
from itertools import combinations_with_replacement as mc
def aupto(limit):
    terms = [p for p in primerange(2, limit//4+1) if p%3 == 2]
    return sorted(set(a*b*c for a, b, c in mc(terms, 3) if a*b*c <= limit))
